import http.server
import socketserver

class ProxyHandler(http.server.SimpleHTTPRequestHandler):
    def do_GET(self):
        print(f"GET {self.path}")
        return http.server.SimpleHTTPRequestHandler.do_GET(self)

    def do_POST(self):
